import { useImperial } from "../contexts/ImperialContext";
import { LongtermForecast } from "./LongtermForecast";

function LongData({ longtermWeather }) {
    const { imperial } = useImperial();
    return (
        <table>
            <tbody>
                {longtermWeather?.list?.map((elem) => (
                    <LongtermForecast
                        data={elem}
                        key={elem?.dt_txt}
                        imperial={imperial}
                    />
                ))}
            </tbody>
        </table>
    );
}

export default LongData;
